import React, { Component } from "react";
import axios from "axios";
class Lyrics extends Component {
  state = {
    track: {},
    lyrics: {}
  };
  componentDidMount() {
    axios
      .get(
        `https://cors-anywhere.herokuapp.com/https://api.musixmatch.com/ws/1.1/chart.tracks.get?chart_name=top&page=1&page_size=10&country=ge&f_has_lyrics=1&apikey=${process.env.REACT_APP_MM_KEY}`
      )

      .then(res => {
        console.log(res.data);
        this.setState({ track_list: res.data.message.body.track_list });
      })

      .catch(err => console.log(err));
  }
  render() {
    return (
      <Context.Provider value={this.state}>
        {this.props.children}
      </Context.Provider>
    );
  }
  render() {
    return (
      <div>
        <h1>Lyrics</h1>
      </div>
    );
  }
}

export default Lyrics;
